import React from "react";

const Servicos = () => {
  return (
    <section className="servicos container" id="servicos">
      <h2 className="subtitulo">Serviços</h2>
      <p>Proporcionamos uma melhor experiência</p>
      <div className="container"></div>
    </section>
  );
};

export default Servicos;
